DROP TABLE IF EXISTS `publishedproject`;
CREATE TABLE IF NOT EXISTS `publishedproject` (
  `Id` bigint(20) NOT NULL,
  `ProductId` bigint(20) NOT NULL,
  `CateId` bigint(20) NOT NULL COMMENT '用户名',
  `ProjectGuid` varchar(36) NOT NULL,
  `ProjectType` tinyint(4) NOT NULL COMMENT '项目类型',
  `Name` varchar(50) NOT NULL COMMENT '密码',
  `Remark` varchar(100) NOT NULL COMMENT '密码重置token',
  `Version` varchar(30) NOT NULL,
  `AlignedVersion` char(30) NOT NULL,
  `ReleaseNote` varchar(500) NOT NULL,
  `ReleaseDate` datetime(3) NOT NULL,
  `OriginalVarJson` text NOT NULL,
  `VarJson` text NOT NULL,
  `IsEnable` tinyint(4) NOT NULL COMMENT '可用状态',
  `VisiblePermission` tinyint(4) NOT NULL,
  `FilePath` varchar(255) NOT NULL,
  `MD5` varchar(255) DEFAULT NULL,
  `BaseCreateTime` datetime(3) NOT NULL,
  `BaseCreatorId` bigint(20) NOT NULL,
  `BaseModifyTime` datetime(3) NOT NULL,
  `BaseModifierId` bigint(20) NOT NULL,
  `BaseVersion` int(11) NOT NULL,
  `BaseIsDelete` tinyint(4) NOT NULL,
  `AssertionCount` int(11) NOT NULL,
  `SupportParallel` tinyint(2) NOT NULL,
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

